import "./about.css";
import Me from "../../img/Potto.JPG";
const about = () => {
  return (
    <div className="a">
      <div className="a-left">
        <div className="a-card bg"></div>
        <div className="a-card">
          <img src={Me} alt="" className="a-img" />
        </div>
      </div>
      <div className="a-right">right</div>
    </div>
  );
};

export default about;
